import { Box,Accordion ,AccordionSummary ,AccordionDetails,Typography, Container  } from '@mui/material'
import React, { useState } from 'react'
import { useTranslation } from "react-i18next";
import AddIcon from '@mui/icons-material/Add';

export default function FAQs() {
  const { t  } = useTranslation();
  const [questions,setQuestions] = useState([
    {
        "id":1,
        "title":"Go Any Where" ,
        "s1":"Classic",
        "s2":"VIP",
        "s3":"Van",
        "s4":"School Rides",
        "n":"GoAnyWhere"
    },
    {
        "id":2,
        "title":"Eat Any Time",
        "s1":"Food",
        "s2":"Dine Out",
        "n":"EatAnyTime"
    },
    {
        "id":3,
        "title":"Get Any Thing",
        "s1":"Super Market",
        "s2":"Delivery",
        "n":"GetAnyThing"
    },
    {
        "id":4,
        "title":"Pay Any one",
        "s1":"Pay",
        "s2":"Packages",
        "n":"PayAnyOne"

    }
] )
  return (
        <Container sx={{ marginBottom:'30px' }}>
        <Box sx={{ width:'100%',
        padding:'80px',borderRadius:'20px',justifyContent:'center'
        ,alignItems:'center' }}>
            <Typography sx={{display:'flex',flexWrap:'wrap',justifyContent:'center',alignItems:'center',fontWeight:'bold',fontSize:'30px',color:"white" ,marginBottom:'20px'}}>
              {t('Top Questions')}
              </Typography>
          

            {questions.map((q)=>
        <Accordion sx={{ padding:'10px',backgroundColor:'transparent','&:before': {display: 'none'}}}
         elevation={0} disableGutters>
        <AccordionSummary
          expandIcon={<AddIcon sx={{ color:'#6499F2' }} />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography sx={{ color:'white',fontSize:'20px' }}>
            {t(q.Question)}</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography sx={{ color:'#0A176E',fontSize:'16px' }}>
           {t(q.answer)}
          </Typography>
        </AccordionDetails>
      </Accordion>)}
      </Box>
        </Container>
  )
}
